import React from 'react';
import './App.css';

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <a href="#!">
              <i class="fas fa-home"></i>
            </a>
          </li>
          <li>
            <a href="#!">Login</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

function App() {
  return (
    <>
      <Header />
    </>
  );
}

export default App;
